import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Container from "@mui/material/Container";
import Card from "@mui/material/Card";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";
import Header from "components/Header";
import { Paper } from "@mui/material";

function Dashboard() {
  const navigate = useNavigate();
  const [players, setPlayers] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const authToken = localStorage.getItem("authToken");
    if (!authToken) {
      navigate("/auth");
      return;
    }

    const fetchPlayers = async () => {
      try {
        const response = await fetch(
          "https://x8ki-letl-twmt.n7.xano.io/api:TF3YOouP/kbfoundation_players",
          {
            headers: {
              Authorization: `Bearer ${authToken}`,
            },
          }
        );

        if (!response.ok) {
          throw new Error("Failed to fetch players data");
        }

        const data = await response.json();
        setPlayers(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setIsLoading(false);
      }
    };

    fetchPlayers();
  }, [navigate]);

  return (
    <>
      <Header />
      <MKBox
        minHeight="100vh"
        width="100%"
        sx={{
          backgroundColor: "#f8f9fa",
          paddingTop: "70px",
          paddingBottom: "30px",
        }}
      >
        <Container>
          <MKTypography variant="h3" mb={4}>
            Players Dashboard
          </MKTypography>
          <Card>
            {isLoading ? (
              <MKBox p={3} textAlign="center">
                Loading players data...
              </MKBox>
            ) : error ? (
              <MKBox p={3} textAlign="center" color="error">
                {error}
              </MKBox>
            ) : (
              <TableContainer component={Paper} sx={{ maxHeight: "70vh" }}>
                <Table stickyHeader sx={{ minWidth: 650 }}>
                  <TableHead>
                    <TableRow>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Full Name
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Email
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Position
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Date of Birth
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Phone Number
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Education
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Registration Date
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          backgroundColor: "#800000",
                          color: "white",
                          fontWeight: "bold"
                        }}
                      >
                        Payment Status
                      </TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {players.map((player, index) => (
                      <TableRow 
                        key={player.id}
                        sx={{ 
                          '&:nth-of-type(odd)': { backgroundColor: '#f5f5f5' },
                          '&:hover': { backgroundColor: '#eeeeee' }
                        }}
                      >
                        <TableCell sx={{ fontWeight: 500 }}>{player.fullName}</TableCell>
                        <TableCell>{player.email}</TableCell>
                        <TableCell>{player.position}</TableCell>
                        <TableCell>{new Date(player.DOB).toLocaleDateString()}</TableCell>
                        <TableCell>{player.phonNumber}</TableCell>
                        <TableCell>{player.education}</TableCell>
                        <TableCell>
                          {new Date(player.created_at).toLocaleDateString()}
                        </TableCell>
                        <TableCell>
                          <MKTypography
                            variant="caption"
                            sx={{
                              backgroundColor: player.paymentReference ? "#e8f5e9" : "#ffebee",
                              color: player.paymentReference ? "#2e7d32" : "#c62828",
                              padding: "4px 8px",
                              borderRadius: "4px",
                              fontWeight: "medium"
                            }}
                          >
                            {player.paymentReference ? "Paid" : "Pending"}
                          </MKTypography>
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            )}
          </Card>
        </Container>
      </MKBox>
    </>
  );
}

export default Dashboard;
